import React, { Component } from "react";
class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  //spacing of links >>
  //link >>color >>change , bold
  //link >> on hover ,on select props
  //brand-name >>color change

  render() {
    return (
      //   <div className = 'overNavDiv'>
      //         <p>No one should be injured or made ill through their work</p>
      //   </div>
      <nav class="navbar navbar-expand-md ">
        <a class="navbar-brand" href="#">
          <strong>MicroSafety</strong>
        </a>

        <button
          class="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#collapsibleNavbar"
        >
          <span class="navbar-toggler-icon"></span>
        </button>

        <div class="collapse navbar-collapse" id="collapsibleNavbar">
          <ul class="navbar-nav ml-auto">
            <li class="nav-item">
              <a class="nav-link" href="#">
                About us
              </a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#">
                Audit and Consultency
              </a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#">
                Training
              </a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#">
                Membership
              </a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#">
                Login
              </a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#">
                Cart
              </a>
            </li>
          </ul>
        </div>
      </nav>
    );
  }
}

export default Navbar;
